import { ReactNode, CSSProperties, useState } from "react";

type Props = {
  type: string
  checked: boolean
};


//checkbox, text
export default function ToDoListItem({ type, checked }: Props) {
  const [isChecked, setChecked] = useState(false);
  return (
        <input 
          type={"checkbox"} 
          checked={false} 
          onChange={(e) => setChecked(e.target.checked)} 
        />
  );
}
